import Data.List

type Memory = ([(Register,Int)], Int)
type Register = String
data Operation = Inc | Dec deriving (Eq,Enum,Show)
data Comparator = Eq | Lt | Lte | Gt | Gte | Neq deriving (Eq,Enum, Show)
type Instruction = (Register, Operation, Int, Register, Comparator, Int)

maxRegisterValue :: Memory -> Int
maxRegisterValue memory = snd $ maximumBy highestValue (fst memory)

highestValue :: (Register,Int) -> (Register,Int) -> Ordering
highestValue (_,x) (_,y)
  | x > y     = GT
  | x < y     = LT
  | otherwise = EQ

executeProgram :: String -> Memory
executeProgram source = foldl execute2 ([], 0) instructions
  where instructions = map parseInstruction (lines source)

execute :: [(Register,Int)] -> Instruction -> [(Register, Int)]
execute regs instrs = fst (execute2 (regs,0) instrs)

execute2 :: Memory -> Instruction -> Memory
execute2 memory (reg1, oper, val1, reg2, comp, val2) = (updatedReg1:others, highest)
  where updatedReg1
          | not comparisonResult = (reg1, oldReg1Value)
          | otherwise            = (reg1, executeOperation oldReg1Value oper val1)
        oldReg1Value = valueOf reg1 memory
        (filteredByReg1, others) = partition (isRegister reg1) (fst memory)
        comparisonResult = executeComparator memory reg2 comp val2
        highest = max (snd $ maximumBy highestValue (updatedReg1:others)) (snd memory)

valueOf :: Register -> Memory -> Int
valueOf reg mem
  | null filteredByReg = 0
  | otherwise          = snd (head filteredByReg)
  where filteredByReg = filter (isRegister reg) (fst mem)

isRegister :: Register -> (Register, Int) -> Bool
isRegister r1 (r2, _)
  | r1 == r2  = True
  | otherwise = False

executeOperation :: Int -> Operation -> Int -> Int
executeOperation i1 o i2
  | o == Dec = i1 - i2
  | o == Inc = i1 + i2

executeComparator :: Memory -> Register -> Comparator -> Int -> Bool
executeComparator mem reg comp val
  | comp == Eq = currentValue == val
  | comp == Lt = currentValue < val
  | comp == Lte = currentValue <= val
  | comp == Gt = currentValue > val
  | comp == Gte = currentValue >= val
  | comp == Neq = currentValue /= val
  where currentValue = valueOf reg mem

parseInstruction :: String -> Instruction
parseInstruction line = parse $ words line

parse :: [String] -> Instruction
parse w = (reg1, oper, val1, reg2, comp, val2)
  where reg1 = head w
        oper = operation (w !! 1)
        val1 = read (w !! 2) :: Int
        reg2 = w !! 4
        comp = comparator (w !! 5)
        val2 = read (w !! 6) :: Int

operation :: String -> Operation
operation s
  | s == "inc" = Inc
  | s == "dec" = Dec

comparator :: String -> Comparator
comparator s
  | s == "==" = Eq
  | s == "<"  = Lt
  | s == "<=" = Lte
  | s == ">"  = Gt
  | s == ">=" = Gte
  | s == "!=" = Neq

